          <td id="LC426" class="blob-code blob-code-inner js-file-line">    &quot;warning_unlock_v13_factory_speed_limit&quot;: &quot;Su seguridad es nuestra mayor prioridad. Para proteger mejor sus derechos personales e intereses, favor leer esta declaración cuidadosamente para asegurar la comprensión de su contenido.\n\n1. Ud comprende y reconoce que está actualmente intentando desbloquear la máxima velocidad del vehículo. Luego de levantarse esta restricción, Ud podrá ajustar el límite de la velocidad máxima hasta los 90km/h.\n2. Ud está consciente y comprende los riesgos asociados con la conducción a ultra alta velocidad y se responsabilizará por cualquier pérdida, or daño o riesgo causado por conducir a alta velocidad.\n3. Ud tiene la obligación de conocer las leyes, normas y reglamentos asociados con la conducción de uniciclos eléctricos en su área y cumplir estrictamente con ello cuando conduzca su V13. No conduzca su V13 en zonas prohibidas por leyes locales.\n4. Favor impedir que su V13 sea conducido por personas que no han leído cuidadosamente las instrucciones o o está familiarizado con las precauciones de seguridad del V13.\n5. Antes de cada viaje, favor revisar que los productos y accesorios están en buenas condiciones; evite utilizar baterías y accesorios no originales; y no desarme, dañe o modifique los productor y accesorios sin previa autorización del fabricante. Ud será responsable de toda pérdida, o daño y riesgo causado por una operación incorrecta.\n\nFavor leer cuidadosamente y decidir si acepta o no esta declaración. La restricción del límite de velocidad máxima no puede ser desbloqueada sin antes confirmar esta declaración. Ud \&quot;concuerda\&quot; será considerada como aceptada esta declaración. Si tiene alguna consulta o duda sobre esta declaración, favor hacer clic en \&quot;Cancelar\&quot;&quot;.</td>
